import Head from "next/head";
import Layout, { siteTitle } from "../component/Layout";

const Home = () => {
  return (
    <>
      <Head>
        <title>{siteTitle}</title>
      </Head>
      <Layout home>
        <div>
          <h1>Hello world</h1>
        </div>
      </Layout>
    </>
  );
};

export default Home;
